import React from 'react'
import { Route } from 'react-router-dom'
import Resturent from './component/Basis/Resturent'
import UseState from './component/Hook/useState'

const App = () => {
    return (
        <div>
            <Resturent/>
            <Route path="./Hook/useState" element={<UseState/>} />

        </div>
    )
}

export default App
